import React, { useEffect, useState } from 'react';
import "animate.css";
import "./main.css";

const Main = () => {
  const [animateClass, setAnimateClass] = useState('');

  useEffect(() => {
    const timer = setTimeout(() => {
      setAnimateClass('animate__animated animate__backInDown'); // إضافة animate__animated
    }, 100); // تأخير 100 ملي ثانية

    return () => clearTimeout(timer); // تنظيف التأخير
  }, []);

  return (
    <main className="main-class"> 
      <div className='flex'>
        <div className={animateClass}>
          <img src={require('../assets/images/Group-12.png').default} alt="" width={250} height={200} />
        </div>
      </div>
    </main>
  );
}

export default Main;
